import React, { Component, useState,ChangeEvent  } from 'react';
export default class Upload extends Component {
    constructor(props) {
        super(props);
        this.state = {
          file:"",
        };
      }

         handleFileChange = (e: ChangeEvent<HTMLInputElement>) => {
          if (e.target.files) {
            setFile(e.target.files[0]);
          }
        };
   handleUploadClick = () => {
    if (!file) {
      return;
    }

    // ðŸ‘‡ Uploading the file using the fetch API to the server
    fetch('https://httpbin.org/post', {
      method: 'POST',
      body: file,
      // ðŸ‘‡ Set headers manually for single file upload
      headers: {
        'content-type': file.type,
        'content-length': `${file.size}`, // ðŸ‘ˆ Headers need to be a string
      },
    })
      .then((res) => res.json())
      .then((data) => console.log(data))
      .catch((err) => console.error(err));
  };
    render() {

        return (
            <Container>
            <form className="fetchFormLogin">
              <Box m={1}>
                <h2>Login</h2>
                {this.state.errMessage && (
                  <Alert>{this.props.message}</Alert>
                )}
              </Box>
              <Box m={1} p={1}>
                <FormControl>
                  <FormLabel>Email:</FormLabel>
                  <TextField
                    name="email"
                    type="email"
                    placeholder="Enter your name"
                    onChange={this.handleChange}
                    value={this.state.nameLogin}
                  />
                </FormControl>
              </Box>
              <Box m={1} p={1}>
                <FormControl>
                  <FormLabel>password</FormLabel>
                  <TextField
                    name="password"
                    type="password"
                    placeholder="Enter your password"
                    onChange={this.handleChange}
                    value={this.state.passwordLogin}
                  />
                </FormControl>
              </Box>
              <Box m={1} p={1}>
                <Button type="button" variant="contained" color="primary" onClick={this.clickLogin}>
                Login
                </Button>
              </Box>
            </form>
            </Container>
        )
      }
  }
